import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Outlet, useNavigate } from 'react-router-dom';

import OsobaList from "./components/HomePage";

function Home() {
    const navigate = useNavigate();

    const handleZalogujButtonClick = () => {
        navigate('/home');
    };

    return (
        <div>
            <button onClick={handleZalogujButtonClick}>Zaloguj</button>
        </div>
    );
}

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/home" element={<OsobaList />} />
            </Routes>
        </Router>
    );
}

export default App;
